INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `code`, `url`, `target`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `galleryTpl`, `playerSRC`, `youtube`, `posterSRC`, `playerSize`, `inline`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `invisible`, `start`, `stop`, `customTpl`, `metaIgnore`, `overwriteMeta`, `vimeo`, `youtubeOptions`, `overwriteLink`, `playerOptions`, `vimeoOptions`, `playerStart`, `playerStop`, `playerColor`, `playerPreload`, `splashImage`, `playerAspect`, `playerCaption`) VALUES(198, 13, 'tl_article', 384, 1396275233, 'text', 'a:2:{s:4:\"unit\";s:2:\"h3\";s:5:\"value\";s:0:\"\";}', '<h3>Contao Official Demo</h3>\n<p>Thank you to the following people who have worked on the Contao Official Demo:</p>\n<p>The screen design for the Contao Offical Demo is sponsored by borowiakziehe KG. It has been designed by Hannes Oertel whom we would like to thank for the great work.</p>\n<p>Implementation:</p>\n<ol>\n<li>Joe Ray Gregory | <a href=\"http://borowiakziehe.de/\" target=\"_blank\">borowiakziehe.de</a></li>\n<li>Sascha Müller | <a href=\"http://bytepuzzle.de/\" target=\"_blank\">bytepuzzle.de</a></li>\n<li>Felix Pfeiffer | <a href=\"http://www.felixpfeiffer.com/\" target=\"_blank\">www.felixpfeiffer.com</a></li>\n<li>Stefan Eipeltauer | <a href=\"http://www.craftandvalue.com/\" target=\"_blank\">www.craftandvalue.com</a></li>\n</ol>\n<p><strong>Helpers and tester:</strong> Alexander[nbsp]Bröss, Christian[nbsp]de[nbsp]la[nbsp]Haye, Fabian[nbsp]Fauth, Carolina[nbsp]Köhn, Dolores[nbsp]Moser, Yanick[nbsp]Witschi, Marc[nbsp]Reimann, Lars[nbsp]Tubies, Stefan[nbsp]Lindecke, Oliver[nbsp]Lohoff and Marie[nbsp]Dietz.</p>\n<h3>Isotope eCommerce Demo</h3>\n<p>Implementation</p>\n<ol>\n<li>Bjarke Ammann | <a href=\"http://www.netzarbeiter.ch/\" target=\"_blank\">netzarbeiter</a></li>\n</ol>\n<p><a href=\"http://www.cede.ch/\" target=\"_blank\">cede.ch</a> provided us with the data for the CD section.</p>\n<p><a href=\"http://www.weitzeldesign.com/\" target=\"_blank\">Thomas Weitzel</a> helped us out designing the t-shirt.</p>\n<p>The fancy icons are made with <a href=\"http://fortawesome.github.io/Font-Awesome/\" target=\"_blank\">Font Awesome</a>.</p>\n<p>Lust but not least - a big thank you to Leo Feyer and the Contao team for this great <a href=\"https://contao.org/\" target=\"_blank\">CMS</a>.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', '', '', '', '', NULL, '', NULL, NULL, 0, 0, '', '', '', 'none', '');
