INSERT INTO `tl_iso_product` (`id`, `pid`, `gid`, `tstamp`, `language`, `dateAdded`, `type`, `orderPages`, `inherit`, `alias`, `sku`, `name`, `teaser`, `description`, `meta_title`, `meta_description`, `meta_keywords`, `baseprice`, `shipping_weight`, `shipping_exempt`, `images`, `protected`, `groups`, `guests`, `cssID`, `published`, `start`, `stop`, `colour`, `size`, `tracks`, `date`, `version`, `fallback`, `shipping_price`, `gtin`, `contao`) VALUES(152, 0, 5, 1504881720, '', 1393516565, 4, 'a:2:{i:0;s:2:\"60\";i:1;s:2:\"61\";}', NULL, 'contao-open-source-cms', '2006', 'Contao Open Source CMS', 'Download', '<p>Contao ist ein Open Source Content Management System (CMS) für alle, die Wert auf eine professionelle Internetpräsenz legen und diese einfach pflegen möchten. Die moderne Architektur des Systems bietet einen hohen Sicherheitsstandard, erlaubt die Entwicklung suchmaschinenfreundli[-]cher und barrierefreier Webseiten und ist flexibel und kostengünstig erweiterbar. Eine umfangreiche Rechteverwaltung, der Live Update Service, das moderne CSS-Framework und viele von Haus aus integrierte Module (News, Kalender, Formulare etc.) haben Contao in kürzester Zeit zu einem der beliebtesten Systeme am Markt für Open Source CMS gemacht.</p>', '', NULL, NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:2:\"kg\";}', '', 0x613a313a7b693a303b613a353a7b733a333a22737263223b733a31303a22636f6e74616f2e706e67223b733a333a22616c74223b733a32323a22436f6e74616f204f70656e20536f7572636520434d53223b733a343a226c696e6b223b733a303a22223b733a343a2264657363223b733a303a22223b733a393a227472616e736c617465223b733a343a226e6f6e65223b7d7d, '', NULL, '', '', '1', '', '', '', '', '', '', '', '', '0.00', '', 0);
INSERT INTO `tl_iso_product` (`id`, `pid`, `gid`, `tstamp`, `language`, `dateAdded`, `type`, `orderPages`, `inherit`, `alias`, `sku`, `name`, `teaser`, `description`, `meta_title`, `meta_description`, `meta_keywords`, `baseprice`, `shipping_weight`, `shipping_exempt`, `images`, `protected`, `groups`, `guests`, `cssID`, `published`, `start`, `stop`, `colour`, `size`, `tracks`, `date`, `version`, `fallback`, `shipping_price`, `gtin`, `contao`) VALUES(161, 152, 0, 1393579780, 'en', 0, 0, NULL, NULL, '', '', 'Contao Open Source CMS', 'Download', '<p>Contao is an open source content management system (CMS) for people who want a professional internet presence that is easy to maintain. The state-of-the-art structure of the system offers a high security standard and allows you to develop search engine friendly websites that are also accessible for people with disabilities. Furthermore, the system can be expanded flexibly and inexpensively. Easy management of user rights, the Live Update Service, the modern CSS framework and many already integrated modules (news, calendar, forms, etc.) have quickly made Contao one of the most popular open source content management systems on the market.</p>', '', NULL, NULL, '', '', '', 0x613a313a7b693a303b613a323a7b733a333a22737263223b733a31303a22636f6e74616f2e706e67223b733a393a227472616e736c617465223b733a333a22616c6c223b7d7d, '', NULL, '', '', '', '', '', '', '', '', '', '', '', '0.00', '', 0);
